function onUAReady()
{
  //create ability to receive user's location without showing additional prompt
   UAirship.location().isLocationUpdatesEnabled = true;
   UAirship.location().autoRequestAuthorizationEnabled = false;
   UAirship.location().isBackgroundLocationUpdatesAllowed = true;



   //set url destinations for CTAs
   let buttonOne = 'buttonOne';
   let buttonTwo = 'buttonTwo';
   var svgToPrint;
   let destinationOne = 'bmw://connected/pnsroute';
   var ctaOne = document.getElementById("ctaOne");
   var ctaTwo = document.getElementById("ctaTwo");
   var swap = document.getElementById("swap");
   var ctaThree = document.getElementById("remindMeLater");
   var language = window.navigator.language;

   //track browser's language settings to display localized text
   if (language == 'de')
   {
     svgToPrint = texts[1].svg;
     swap.outerHTML = svgToPrint;
   }
   else if (language == 'en')
   {
     svgToPrint = texts[0].svg;
     swap.outerHTML = svgToPrint;
   }


   // trigger button actions
   ctaOne.disabled = false
   ctaOne.addEventListener("click", function()
   {
     UAirship.close();
   });

   ctaTwo.disabled = false
   ctaTwo.addEventListener("click", function(event)
   {
      UAirship.runAction("deep_link_action", destinationTwo, function()
      {
        return true;
      })
    });

   ctaThree.disabled = false;
   ctaThree.addEventListener("click", function(event)
   {
       UAirship.close();
   });
};

document.addEventListener('ualibraryready', onUAReady, false);
